export default class addQuestion extends Component {
  render() {
    return (
      <div className="App-header">
        <form>
          <label>
            Pytanie<br />
            <input type="text" name="question" style={{width: "700%"}}/>
            <br/>
            Odpowiedź<br />
            <input type="text" name="answer" />
          </label>
          <br />
          <input type="submit" value="Wyślij" />
        </form>
      </div>
    );
  }
}
